  KEY `user_id` (`user_id`),
  KEY `account_id` (`account_id`),
  CONSTRAINT `ibfk_5d17366a01f7d` FOREIGN KEY (`user_id`) REFERENCES `np_users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
